      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";

interface NftInterface{
    function mintNFTs(uint count) external;
    function transferFrom(address _from, address _to, uint256 _id) external;
    function totalSupply() external view returns (uint256);
}


contract ElegantProxy is Ownable, IERC721Receiver {

    address public racerNft = 0x72106Bbe2b447ECB9b52370Ddc63cfa8e553B08C;
    //how many this proxy contract can mint
    uint256 public SUPPLY;
    //how many it has already minted
    uint256 public minted = 46;
    uint256 public PRICE;
    bool public whiteListOnly = true;
    bool public paused = false;

    constructor () {
        teamInfo[msg.sender].member = true;
    }

    struct theTeam {
        bool member;
        uint percentage;
        uint takenSoFar;
        uint nutsTaken;
    }

    mapping(address => theTeam) public teamInfo;
    uint256 public totalEarned = 0;

    mapping(address => uint) public isWhiteListed;

    // ADMIN //
    function teamUpdate(address to, bool _member, uint _perc) public {
        require(teamInfo[msg.sender].member == true, "Caller is not a member of the team.");
        teamInfo[to].member = _member;
        teamInfo[to].percentage = _perc;
    }

    function pause(bool _state) public {
        require(teamInfo[msg.sender].member == true, "Caller is not a member of the team.");
        paused = _state;
    }

    function updatePrice(uint _maticPrice) public {
        require(teamInfo[msg.sender].member == true, "Caller is not a member of the team.");
        PRICE = _maticPrice;
    }

    function updateSupply(uint _newSupply) public {
        require(teamInfo[msg.sender].member == true, "Caller is not a member of the team.");
        SUPPLY = _newSupply;
    }

    // WHITELIST //
    function whiteList(address[] calldata _users) public {
        require(teamInfo[msg.sender].member == true, "Caller is not a member of the team.");
        address[] memory toWhiteList;
        toWhiteList = _users;
        for(uint256 i=0; i < toWhiteList.length; i++){
            isWhiteListed[toWhiteList[i]] = isWhiteListed[toWhiteList[i]] + 1;
        }
    }

    function setWLOnly(bool _only) public {
        require(teamInfo[msg.sender].member == true, "Caller is not a member of the team.");
        whiteListOnly = _only;
    }

    function checkWL(address _check) public view returns(bool){
        return (isWhiteListed[_check] > 0);
    }

    //MINT
    function mintByProxy(address _to, uint256 _amount) public payable {
        if (whiteListOnly == true){
            require(isWhiteListed[msg.sender] >= _amount, "You don't have enough whitelist spots for that.");
            isWhiteListed[msg.sender] = isWhiteListed[msg.sender] - _amount;
        }
        require((minted + _amount) <= SUPPLY, "Not enough NFTs remaining!");
        require(msg.value >= (PRICE * _amount), "Not enough matic!");
        totalEarned = totalEarned + (PRICE * _amount);
        NftInterface _nft = NftInterface(racerNft);
        uint256 total = _nft.totalSupply() + 1;
        _nft.mintNFTs(_amount);        
        for (uint i = 0; i < _amount; i++){
            _nft.transferFrom(address(this), _to, total + i);
        }
        minted = minted + _amount;
    }

    // WITHDRAWAL //
    function withdraw() public {
        require(teamInfo[msg.sender].member == true, "Caller is not a member of the team.");
        uint payOut = calculateEarnings(msg.sender);
        uint _soFar = teamInfo[msg.sender].takenSoFar;
        teamInfo[msg.sender].takenSoFar = _soFar + payOut;
        (bool success, ) = (msg.sender).call{value: payOut}("");
        require(success, "Transfer failed.");
    }
    
    function calculateEarnings(address _addy) public view returns (uint) {
        uint256 returnNum = 0;
        uint _cut = teamInfo[_addy].percentage;
        uint _taken = teamInfo[_addy].takenSoFar;
        uint256 _total = (totalEarned * _cut)/100;
        returnNum =  _total - _taken;
        return returnNum;
    }

    // DEBUG AND MANAGEMENT //

    function returnSupply() external view returns(uint256){
        return SUPPLY;
    }

    function returnMinted() external view returns(uint256){
        return minted;
    }

    function onERC721Received(address _op, address _from, uint256 _token, bytes memory) public virtual override returns (bytes4) {
        require((msg.sender == racerNft),"Contract not recognised!");

        return this.onERC721Received.selector;
    }

    fallback() external payable {}

    receive() external payable {
    }
}"
